@Shubuu17 Dost, I worked in the Company which prints VVPAT.
Be assured there is no fault in it.
This INTELLECTUAL KABAAL which speaks NARRATIVE against EVM and VVPAT are just bogus.

@deshbhakt I must say, you don't understand Bengal's politics, especially the politics of Mamata Banerjee. She is a natural ally of the BJP. Adhir Ranjan is absolutely correct in this matter. Mamata, along with Suvendu (now BJP), systematically destroyed the West Bengal Congress through the use of tools like the NDPC and various other fake cases.

Before joining hands with Mamata, the national Congress should completely shut down their West Bengal branch. Common Congress workers continue to face TMC's atrocities while the so-called high command considers an alliance with Mamatait would be a farce.

I'm quite glad that the INDIA alliance is keeping a distance from this "Modi with saree and choti" for now. Mark my words: if the BJP needs 5-6 seats to form the government, Mamata will be ready with her seats, upfront.
